𝗪𝗵𝗮𝘁 𝗰𝗼𝗹𝗼𝘂𝗿𝘀 𝘁𝗼 𝗮𝘃𝗼𝗶𝗱 𝗳𝗼𝗿 𝘆𝗼𝘂𝗿 𝗱𝗼𝗼𝗿?
你应该避免使用哪种颜色的门？

"After painting the door to another colour, I was relieved from a strange health issue!
&lt;“当我把门漆成另一个颜色后，我奇怪的健康问题竟然消失了！&gt;

In the past five years, I suffered from neck and shoulder muscle aches and sought many treatments, which only relieved me for a few days.
&lt;五年来，我的颈部和肩膀肌肉一直酸痛， 虽然治疗了很多次，但也就缓解几天而已。&gt;

But this time, the ache just disappeared, and surprisingly, my mind is also clearer!" - Uncle Lim.
&lt;不过这一次，酸痛就突然消失了，而且很意外的，我的思绪也更加清楚了！” - 林叔叔。&gt;

This was one of the successful cases in which I turned a person's luck and health around by using the right door colour.
&lt;这是我通过使用正确的大门颜色，转变一个人的运气和健康的其中一个成功案例。&gt;

Door colour plays a crucial role in home Fengshui; a suitable one can improve luck tremendously, while the wrong one can bring you lots of trouble! 
&lt;大门颜色在住家风水方面扮演关键的角色；合适的颜色能大幅度的改变运气，错误的则会给你带来很多的烦恼！&gt;

Remember to 𝙎𝙖𝙫𝙚 &amp; 𝙎𝙝𝙖𝙧𝙚 this post and 𝙨𝙬𝙞𝙥𝙚 through the pictures to know generally the colours to avoid before Year 2024!
&lt;记得将这个贴子储存起来并分享出去，和浏览这些图像，以便知道在2024年前大门一般应该避免哪些颜色！&gt;
.
