𝗜𝘀 𝗶𝘁 𝗯𝗮𝗱 𝗳𝗼𝗿 𝘁𝗵𝗲 𝘀𝘁𝗼𝘃𝗲 𝘁𝗼 𝗳𝗮𝗰𝗲 𝘁𝗵𝗲 𝘀𝗶𝗻𝗸?
炉灶对着水槽不好吗？

Have you heard of the 𝒘𝒂𝒕𝒆𝒓 𝒄𝒍𝒂𝒔𝒉𝒆𝒔 𝒘𝒊𝒕𝒉 𝒇𝒊𝒓𝒆 theory? 
&lt;有听说过【水火不容】这个理论吗？&gt;

According to some people, the stove's element is fire🔥, while the sink's element is water💧. The water element will negate the fire when the stove faces the sink or next to it, hence the theory.
&lt;据某些人说，炉灶属火，水槽属水。所以当炉灶在水槽的对面或旁边，水就克火，所以叫做【水火不容】。&gt;

Next, they will assume frequent arguments within the family and some may even suffer from illnesses related to fire and water.
&lt;再来，他们就会认为家中经常有是非口舌、甚至有与水和火有关的疾病。&gt;

However, after I learned from my HK Grandmaster and audited hundreds of houses, I know that 𝒘𝒂𝒕𝒆𝒓 𝒄𝒍𝒂𝒔𝒉𝒆𝒔 𝒘𝒊𝒕𝒉 𝒇𝒊𝒓𝒆 is a myth.
&lt;但是后来，我向香港风水老师学习又看了数百间房子之后，我知道【水火不容】只是个传说。&gt;

Because whether the stove is beneficial to the family members, the Qi at the stove position is pivotal. 
&lt;因为一个炉灶对家人好不好，炉位的气场才是重点。&gt;

It has nothing to do with the sink, washing machine and refrigerator.
&lt;跟水槽、洗衣机和电冰箱是没关系的。&gt;

If your stove position happens to violate the theory, but your family member's physical and mental health is good, then you don't have to worry about the stove position.
&lt;如果你的炉灶位刚好犯了【水火不容】，但全家的身心健康没问题，那你不必再为炉位而操心了。&gt;

