Frog porridge and Zi Char💘

@Huazai_frogporridgezichar is an absolute gem! It’s a Zichar stall in a coffee shop at 332 Ang Mo Kio Ave 1😋 They serve delectable Chinese dishes from Claypot frog porridge, Curry Fish Head to seafood at affordable prices😊

We tried their recommended dishes&nbsp;

🔸️Claypot Frog Leg with Spring Onions and Ginger: The frog legs are juicy and tender! It pairs really well with their creamy plain porridge (served in a claypot too)😘

 For the best experience, drizzle some sauce from the Claypot Frog Leg into the porridge. Frog thighs are rich in omega-3 fatty acids, potassium and vitamin A. The taste and texture of the meat is softer, like a mixture of chicken and fish. Compared to grilled chicken breast, frog meat has far more protein and is lower in fat🐸&nbsp;

🔸️Curry Fish Head: The fish is so fresh and huge, which makes it so enjoyable. The curry is thick and coats the accompanying ingredients so well🤤🌹 There’s brinjal, beancurd skin and other vegetables that make the meal very wholesome.&nbsp;

🔸️Broccoli with scallops & mushroom: It’s always a good idea to order a plate of greens to accompany all the meat dishes. The scallops are huge and savory!&nbsp;

🔸️Sliced fish with Spring Onions: For the lazy foodies who want to enjoy fish without removing their bones, this is the dish for you. The smooth and tender fish slices get a huge thumbs up from us.&nbsp;

They are opened daily from 11.45am till 10pm

Islandwide Delivery 👇

