I received a box of 4 beautiful homemade fruit tarts last week. Fruit tarts are usually rather expensive hence I was taken aback when I saw the pricing. Pricing was really reasonable given the exquisite design and yummy taste. I can sense there is a lot of pride and efforts put into these tarts.&nbsp;

📍 @180ovenbaked 

I’ve tried:
• 𝐋𝐞𝐦𝐨𝐧 𝐌𝐞𝐫𝐢𝐧𝐠𝐮𝐞 𝐓𝐚𝐫𝐭 (𝐒$𝟐.𝟓𝟎) 🍋
• 𝐀𝐩𝐩𝐥𝐞 𝐓𝐚𝐫𝐭 (𝐒$𝟐.𝟖𝟎) 🍎
• 𝐒𝐭𝐫𝐚𝐰𝐛𝐞𝐫𝐫𝐲 𝐓𝐚𝐫𝐭 (𝐒$𝟐.𝟖𝟎) 🍓
• 𝐄𝐚𝐫𝐥 𝐆𝐫𝐞𝐲 𝐂𝐡𝐨𝐜𝐨𝐥𝐚𝐭𝐞 𝐓𝐚𝐫𝐭 (𝐒$𝟑.𝟕𝟎) 🍫&nbsp;

I like everything that I’ve tried and my favorite goes to Lemon Meringue Tart - it was light, buttery, tangy and sweet. A perfect snack for an afternoon tea. And if you enjoy dark chocolate flavor, be sure not to miss out the earl grey choco tart. &nbsp;

Seriously, you just gotta try out these amazing desserts for yourself! It certainly makes a wonderful gift and is friendly on our pockets too =)&nbsp;

Check out them today ♡ 

